import React from 'react';
import "./mainContent.css"
import FirstContent from './firstContent/firstContent';
import InfoProduct from './infoProduct/infoProduct';

const MainContent = () => {
    return (
        <main className='MainContent'>
            <FirstContent/>
            <InfoProduct/>
        </main>
    );
}

export default MainContent;
